#include <iostream>
#include <vector>
#include <queue>

using namespace std;

class Solution {
public:
    int minKBitFlips(vector<int>& nums, int k) {
        int n = nums.size();
        int ans = 0;
        deque<int> dq;
        for (int i = n - 1; i >= k - 1; i--){
            if (!dq.empty() && dq.back() > i) dq.pop_back();
            if ((dq.size() % 2 ^ nums[i]) == 0){
                ans++;
                dq.push_front(i - k + 1);
            }
        }
        for (int i = k - 2; i >= 0; i--){
            if (!dq.empty() && dq.back() > i) dq.pop_back();
            if ((dq.size() % 2 ^ nums[i]) == 0) return -1;
        }
        return ans;
    }
};

